@justin jz 1. Bad bunny por más Views que tenga nunca le pasará el rolo a  Daddy Yankee
2.  Daddy no le metió el pie a J Álvarez por tirarle, lo que pasó fue que los artistas del género y también el público como le tenían respeto a Daddy, al ver que j Álvarez le tiró a Daddy comenzaron a rechazarlo, y el mismo Álvarez lo dice en una entrevista
3. Bad bunny solo seria el dueño pero de su género que es el Trap, del reggaeton está complemente lejos de considerarse tan siquiera líder con su música vulgar

